   "source": [
    "# Create a data frame with the users' mean heart rate per hour\n",
    "hourly_hrate <-\n",
    "  heart_rate %>%\n",
    "  group_by(Id, time=floor_date(Time, '1 hour')) %>%\n",
    "  summarize(mean_hrate=round(mean(Value)))"
   ]
  },
